import sqlite3
import json

# Kết nối và tạo bảng nếu bảng chưa tồn tại thì sẽ tạo ra bảng
conn = sqlite3.connect('C:\\Users\\dangn\\PycharmProjects\\Law\\Đồ_Án\\database\\products.db')
cursor = conn.cursor()
cursor.execute("""
CREATE TABLE IF NOT EXISTS products (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    product_name TEXT,
    price TEXT,
    address TEXT,
    map TEXT,
    category TEXT
)
""")
formatted_products = []

json_data = [
    "C:\\Users\\dangn\\PycharmProjects\\Law\\Đồ_Án\\crawldata\\data_in_json\\raw_data_in_json\\smartphones.json",
    "C:\\Users\\dangn\\PycharmProjects\\Law\\Đồ_Án\\crawldata\\data_in_json\\raw_data_in_json\\tablets.json",
    "C:\\Users\\dangn\\PycharmProjects\\Law\\Đồ_Án\\crawldata\\data_in_json\\raw_data_in_json\\laptop.json",
    "C:\\Users\\dangn\\PycharmProjects\\Law\\Đồ_Án\\crawldata\\data_in_json\\raw_data_in_json\\earphone.json",
    "C:\\Users\\dangn\\PycharmProjects\\Law\\Đồ_Án\\crawldata\\data_in_json\\raw_data_in_json\\speakers.json",
    "C:\\Users\\dangn\\PycharmProjects\\Law\\Đồ_Án\\crawldata\\data_in_json\\raw_data_in_json\\watches.json"
]

for file in json_data:
    with open(file,"r",encoding="utf-8") as json_file:
        data = json.load(json_file)
        for item in data:
            formatted_products.append(item)

formatted_products = list(set(formatted_products))

# Đoạn code này dùng để insert vào bảng database để phục vụ mục đích cho câu hỏi về giá và địa chỉ
product_types = ["smartphone", "tablet", "laptop", "earphone", "speaker", "watch"]

for index, data in enumerate(json_data):
    with open(data, "r", encoding="utf-8") as f:
        loaded_data = json.load(f)

    for item in loaded_data:
        address_data = item.get("address")
        if not isinstance(address_data, dict):
            continue
        if address_data.get("Thông báo") == "Không có chi nhánh nào có sản phẩm này":
            continue

        name = item.get("product_name", "")
        price = item.get("price", {}).get("Giá chính thức", "")

        for addr_name, addr_text in address_data.items():
            address = addr_text.strip()

            cursor.execute(
                "INSERT INTO products (product_name, price, address, map, category) VALUES (?, ?, ?, ?, ?)",
                (name, price, address, "", product_types[index])
            )

conn.commit()
conn.close()
print("Đã tạo và lưu dữ liệu SQLite thành công.")


